import React from "react";

const Header = () => {
  return (
    <header className="bg-slate-900 text-white p-4">
      <nav>
        <ul className="flex justify-end space-x-4">
          <li>
            <a href="#about">About</a>
          </li>
          <li>
            <a href="#projects">Projects</a>
          </li>
          <li>
            <a href="#contact">Contact</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
